demo HTML file with JS code to reproduce

The issue is whenever a developer creates a collection and runs an animation on it the animations fails with an error if the collection does reference the *same* element.

Sample code looks like this (this should lighten things up):

--snap--
q.ready(function() {
  q("button").on("click", function(e) {
    var coll = q('#container');
    coll.setScrollLeft(coll.getScrollLeft() + 100, 1000);
  });
})
--snap--

The issue here is that at each "click" a new collection is created. Whenever the user clicks a second time during the animation still runs it fails with an error.
